import React from 'react';
import './QuizButton.css'; // Import your CSS file

const QuizButton = ({ option, onClick }) => {
  return (
    <button className="quiz-button" onClick={() => onClick(option)}>
      {option}
    </button>
  );
};

export default QuizButton;
